class Solution:
    def replaceAliens(self, board: List[List[str]]) -> List[List[str]]:
        m = len(board)
        n = len(board[0])
        for i in range(m):
            for j in range(n):
                if board[i][j] == "f":
                    self._replace(board, i, j, 0, 0)
        return board

    @staticmethod
    def _replace(board: List[List[str]], x: int, y: int, dx: int, dy: int) -> None:
        if not (0 <= x < len(board)) or not (0 <= y < len(board[x])):
            return
        if board[x][y]!= "f":
            return
        board[x][y] = "c"
        for k in range(-dx, dx + 1):
            for l in range(-dy, dy + 1):
                if k == 0 and l == 0:
                    continue
                elif -dx <= k <= dx and -dy <= l <= dy:
                    x += k
                    y += l
                    if 0 <= x < len(board) and 0 <= y < len(board[x]):
                        if board[x][y] == "f":
                            board[x][y] = "c"
                        else:
                            break
                    else:
                        break
                else:
                    break
        return

