class Solution(object):
    def convertBST(self, root):
        """
        :type root: TreeNode
        :rtype: TreeNode
        """

        if not root or not root.left:
            return root

        queue = collections.deque()
        queue.append((root, 0))
        while len(queue) > 0:
            node, level = queue.popleft()
            if node is None:
                continue

            if level % 2 == 0:
                node.val = "f"
            else:
                node.val = "b"

            if node.right:
                queue.append((node.right, level + 1))
            if node.left:
                queue.append((node.left, level - 1))

        return root

