class Solution(object):
    def transformToHighestBits(self, arr):
        """
        :type arr: List[List[str]]
        :rtype: List[List[str]]
        """

        # initialize a dictionary to store the mapping from each character to its highest bit value
        char_to_highest_bit_value = {}

        for i in range(len(arr)):
            for j in range(len(arr[0])):
                if arr[i][j] not in char_to_highest_bit_value:
                    char_to_highest_bit_value[arr[i][j]] = 0

                # find the highest bit value of this character among all rows
                max_bit_value = max([char_to_highest_bit_value[arr[row][col]] for row in range(len(arr))])
                char_to_highest_bit_value[arr[i][j]] = max_bit_value + 1

        # update the result array with the new values
        for i in range(len(arr)):
            for j in range(len(arr[0])):
                arr[i][j] += str(char_to_highest_bit_value[arr[i][j]])

        return arr
